os\",\"what is cloud\",\"cloud photos\",\"cloud storage\",\"How to use cloud for photos\"],\"channelId\":\"UCmGSJVG3mCRXVOP4yZrU1Dw\",\"isOwnerViewing\":false,\"shortDescription\":\"Most of your life you just can't remember. \\nAll music made specifically for this video by Producer Tom Fox. https:\/\/www.johnnyharris.tv\/music At that link you can buy his music for your own videos if you want.\\n\\nThis video explores how I organize pictures. You probably have more pictures than you know what to do with. Phones are amazing for taking lots of shots but often the result is too many photos. I have been thinking about how to organize photos for a really long time and this is my workflow to best remember your life by using photos. It uses cloud based storage between my phone and computer to help me see my photos often and it also uses some guiding concepts that help me delete more photos and better enjoy the ones I keep around. I hope this helps at least one person better remember their lives. \\n\\n\\nSubscribe to my channel if you want it to will be less tiny: https:\/\/goo.gl\/1U8Zy7\\nMy Instagram: https:\/\/www.instagram.com\/johnnywharris\/\\nIz' Channel  https:\/\/www.youtube.com\/iz-harris\\nGear I use: https:\/\/goo.gl\/qxMR2o \\nSubscribe to my channel if you want it to: https:\/\/goo.gl\/1U8Zy7\\nI send an email once a month with a Spotify playlist sign up if that sounds cool: http:\/\/eepurl.com\/dNa8zk\\nFacebook: https:\/\/www.facebook.com\/JohnnyHarrisVox\/ \\n\\nJohnny Harris is a filmmaker and journalist. He currently is based in Washington, DC where he makes web videos for Vox.com, reporting on interesting trends and stories domestically and around the globe. Johnny's visual style blends motion graphics with cinematic videography to create content that explains complex issues in relatable ways. He holds a BA in international relations from Brigham Young University and an MA in international peace and conflict resolution from American University.\\n\\nMo  uses cloud based storage between my phone and computer to help me see my photos often and it also uses some guiding concepts that help me delete more photos and better enjoy the ones I keep around. I hope this helps at least one person better remember their lives. \\n\\n\\nSubscribe to my channel if you want it to will be less tiny: https:\/\/goo.gl\/1U8Zy7\\nMy Instagram: https:\/\/www.instagram.com\/johnnywharris\/\\nIz' Channel  https:\/\/www.youtube.com\/iz-harris\\nGear I use: https:\/\/goo.gl\/qxMR2o \\nSubscribe to my channel if you want it to: https:\/\/goo.gl\/1U8Zy7\\nI send an email once a month with a Spotify playlist sign up if that sounds cool: http:\/\/eepurl.com\/dNa8zk\\nFacebook: https:\/\/www.facebook.com\/JohnnyHarrisVox\/ \\n\\nJohnny Harris is a filmmaker and journalist. He currently is based in Washington, DC where he makes web videos for Vox.com, reporting on interesting trends and stories domestically and around the globe. Johnny's visual style blends motion graphics with cinematic videography to create content that explains complex issues in relatable ways. He holds a BA in international relations from Brigham Young University and an MA in international peace and conflict resolution from American University.\\n\\nMore from Johnny \\n\\nVox: https:\/\/www.vox.com\/authors\/johnny-harris \\nSpotlight: http:\/\/byupoliticalscienceblog.com\/2016\/03\/09\/alumnus-spotlight-johnny-harris\/ \\nXYNTEO Interview: https:\/\/xynteo.com\/the-power-of-storytelling-with-johnny-harris\/\\nBonnier Talk: https:\/\/vimeo.com\/232416596 \\nNeiman Lab: https:\/\/tinyurl.com\/ybjbvb7h\\nEmmy Nomination: https:\/\/tinyurl.com\/y9gjgel2 \\nStorytelling Tips: http:\/\/chase.be\/blog\/5-storytelling-tips-by-johnny-harris\/ \\nCraig Adams Podcast: https:\/\/open.spotify.com\/episode\/4cS0vEIt2p69Wva6BnXGdR \\nSo Money Podcast: https:\/\/tinyurl.com\/ycjbl4p5\"},\"lengthSeconds\":\"967\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/johnnymangosteen\",\"exte oo many photos. I have been thinking about how to organize photos for a really long time and this is my workflow to best remember your life by using photos. It uses cloud based storage between my phone and computer to help me see my photos often and it also uses some guiding concepts that help me delete more photos and better enjoy the ones I keep around. I hope this helps at least one person better remember their lives. \n\n\nSubscribe to my channel if you want it to will be less tiny: https://goo.gl/1U8Zy7\nMy Instagram: https://www.instagram.com/johnnywharris/\nIz' Channel  https://www.youtube.com/iz-harris\nGear I use: https://goo.gl/qxMR2o \nSubscribe to my channel if you want it to: https://goo.gl/1U8Zy7\nI send an email once a month with a Spotify playlist sign up if that sounds cool: http://eepurl.com/dNa8zk\nFacebook: https://www.facebook.com/JohnnyHarrisVox/ \n\nJohnny Harris is a filmmaker and journalist. He currently is based in Washington, DC where he makes web videos for Vox.com, reporting on interesting trends and stories domestically and around the globe. Johnny's visual style blends motion graphics with cinematic videography to create content that explains complex issues in relatable ways. He holds a BA in international relations from Brigham Young University and an MA in international peace and conflict resolution from American University.\n\nMore from Johnny \n\nVox: https://www.vox.com/authors/johnny-harris \nSpotlight: http://byupoliticalscienceblog.com/2016/03/09/alumnus-spotlight-johnny-harris/ \nXYNTEO Interview: https://xynteo.com/the-power-of-storytelling-with-johnny-harris/\nBonnier Talk: https://vimeo.com/232416596 \nNeiman Lab: https://tinyurl.com/ybjbvb7h\nEmmy Nomination: https://tinyurl.com/y9gjgel2 \nStorytelling Tips: http://chase.be/blog/5-storytelling-tips-by-johnny-harris/ \nCraig Adams Podcast: https://open.spotify.com/episode/4cS0vEIt2p69Wva6BnXGdR \nSo Money Podcast: https://tinyurl.com/ycjbl4p5","isCrawlable":true,"thumbnail"
